import Modal from "../../UI/Modal";
import classes from "./Details.module.css";

const Details = (props) => {
  return (
    <Modal>
      {props.children}
      <div>titulo</div>
      <div>imagen</div>
      <div>descripcion</div>
      <div className={classes.actions}>
        <button
          className={classes["button--alt"]}
          onClick={props.onHideDetails}
        >
          Close
        </button>
      </div>
    </Modal>
  );
};

export default Details;
